レーシングシート専用の難燃素材のシート生地を切り売り販売いたします。裏地には難燃素材のウレタンクッション付きで、伸び縮みが自由に利くので張りやすくＤＩＹも可能です。 <br>レーシングシートに合わせたインテリアコーディネートには最適。ドアートリム・フロアー・天井等さまざまなポイントに使用できます。幅は余裕の1500mm。<br>1ｍ単位での切り売りいたします。1ｍ＝1個で、数量を指定してください。たとえば4ｍご希望のお客様でしたら4個となります。また切り売りに付き返品・交換には応じることが出来ませんのでご了承ください。 <br>ユニバーサル <br>　競技専用品<br>インテリア/インテリアその他<tr><td colspan="2">
