簡単に取り付けができるベッドキットです。行楽に、仕事に、いろいろなシーンでお使いいただけるはずです。 シルバー仕上げされたスチール製の支え部分は3段階の高さ調節ができるため、荷物の大きさに合わせて位置を設定する事が可能です。 <br><br>●標準ボディー用 ●ベース部：スチール ●ベッド部：ウッド/ウレタン/ビニールレザー ●受注生産品<br><br>※本製品は受注生産品のため受注後のキャンセルは不可です。お急ぎの方はご注文前に必ず納期をご確認下さい。 <br><br>対応車種 ： 200系 ハイエース 標準 <br><br>車検対応品<br><br>インテリア/インテリアその他<tr><td colspan="2">
